column5:
I love it.

&#x200B;

Aaaaaand I now have a new reaction pic.

I couldn't care less. If people don't care then why do they make such a big deal out of it when comparing chips? I remember listening to people at work spend a lot of time discussing it when debating chips.

&#x200B;

I define consumer as anyone buying. But maybe my definition is different than yours.

I will absolutely defend the arrests of crack dealers, meth dealers, cartel members, etc.

&#x200B;

But this post is about no-knock raids and the claim they they are never, under any circumstances, at any time, justified. Not about the war on drugs.
